// SPDX-License-Identifier: MIT
pragma solidity ^0.8.15;

import "@openzeppelin/contracts/utils/cryptography/MerkleProof.sol";

// @title Merkle Verifier
// @notice Utility to verify merkle proofs
contract MerkleVerifier {

    // @notice Verify caller's address against provided root and proof
    function verify(bytes32 root, bytes32[] calldata proof)
    external view returns (bool) {
        return MerkleProof.verify(proof, root, bytes32(abi.encodePacked(msg.sender)));
    }

    // @notice Verify address against root and proof
    function verify(bytes32 root, bytes32[] calldata proof, address leaf)
    external pure returns (bool) {
        return MerkleProof.verify(proof, root, bytes32(abi.encodePacked(leaf)));
    }
}
